import React from 'react'
import { withFirebase } from '../contexts/FirebaseContext';

  function SignOut({}) {
    const auth = firebase.auth()
    return (
      <button onClick= {() => auth.signOut()}>Sign Out</button>
    )
  }

  export default withFirebase(SignOut);
